import React from "react";
import Heading from "./heading";
import Hero from "./hero";
import About from './aboutus'
import Services from "./services"
import Tour from "./tour";
function App(){
return(
    <div classNameName="app">
        <Heading/>
        <Hero/>
        <About/>
        <Services/>


    

   
    <script src="./js/app.js"></script>
  
    </div>
)
}
export default App;
